import { commonDark } from '../../_styles/common';
import { avatarDark } from '../../avatar/styles';
const avatarGroupDark = {
    name: 'AvatarGroup',
    common: commonDark,
    peers: {
        Avatar: avatarDark
    }
};
export default avatarGroupDark;
